import React from 'react';
import logo from './logo.svg';
import Welcome from './components/Welcome';
import './App.css';
import Greet from './components/Greet';
import Hello from './components/Hello';

function App() {
  return (
    <div className="App">

     <Greet/>
      <Welcome/> 

      <Hello></Hello>
    </div>
  );
}

export default App;
